import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Letters from './components/letters';
function App() {
  return (
    <div className="App" style={{backgroundColor: lightgreen}}>
      <h1>Hangman</h1>
      <Letters></Letters>
    </div>
  );
}
export default App;
